import UIKit

class MyPrivateDataRouter: MyPrivateDataWireframeProtocol {
    weak var viewController: UIViewController?

    static func createModule() -> UIViewController {
        let view = MyPrivateDataViewController()
        let interactor = MyPrivateDataInteractor()
        let router = MyPrivateDataRouter()
        let presenter = MyPrivateDataPresenter(interface: view, interactor: interactor, router: router)

        view.presenter = presenter
        interactor.presenter = presenter
        router.viewController = view

        return view
    }
}
